  function convertToTreeStructure(originalData) {
  // 创建哈希映射加速节点查找
  const nodeMap = new Map();
  const tree = [];
  
  // 第一遍遍历：创建基础节点并记录层级关系
  originalData.forEach(item => {
    nodeMap.set(item.id, {
      label: item.name,
      key: `${item.id}`,      // 使用唯一ID生成key
      grade: item.grade,
      parentId: item.parentId,
      children: []
    });
  });

  // 第二遍遍历：构建树形结构
  originalData.forEach(item => {
    const currentNode = nodeMap.get(item.id);
    
    if (item.parentId === "0") {
      // 根节点直接加入结果树
      tree.push(currentNode);
    } else {
      // 将当前节点挂载到父节点
